import React, {Component} from 'react';
import './Content.css';

class Content extends Component{
    render(){
        return(
            <div>
                <div className="Content">
                <h1>Resturant Title</h1>
                <h3>Location</h3>
                <p className="title" >The Good Fork</p>
                <p>The Good Fork was a place I would have never discovered if my friends didn't find it online.</p>
                </div>
            </div>
        );

    }
}

export default Content
